    private string username;
    private string password;
    private string errorMessage;
    private string errorMessageUname;
    private string errorMessagePsw;
    private bool loading = false;
    private string displyBtn;

    public async Task PerformLogin()
    {
        errorMessageUname = "";
        errorMessagePsw = "";
        try
        {
            loading = true;
            await ((CustomAuthenticationStateProvider) AuthenticationStateProvider).ValidateLogin(username, password);
            NavigationManager.NavigateTo("/");
            loading = false;
            username = "";
            password = "";
            displyBtn = "block";
        }
        catch (Exception e)
        {
            if (e.Message.Equals("Enter username"))
            {
                loading = false;
                errorMessageUname = e.Message;
                errorMessagePsw = "";
                displyBtn = "none";
            }
            else if (e.Message.Equals("Enter password"))
            {
                loading = false;
                errorMessageUname = "";
                errorMessagePsw = e.Message;
                displyBtn = "none";
            }
            else
            {
                loading = false;
                errorMessage = e.Message;
                displyBtn = "none";
            }
        }
    }

    public async Task PerformLogout()
    {
        errorMessageUname = "";
        errorMessagePsw = "";
        errorMessage = "";
        try
        {
            ((CustomAuthenticationStateProvider) AuthenticationStateProvider).Logout();
            NavigationManager.NavigateTo("/");
            username = "";
            password = "";
        }
        catch (Exception e)
        {
        }
    }

    private string disply1 = "none";
    private string disply2 = "none";

    private void change(ChangeEventArgs changeEventArgs)
    {
        if (!string.IsNullOrEmpty(changeEventArgs.Value.ToString()))
        {
            disply1 = "block";
            errorMessageUname = "";
            errorMessage = "";
            displyBtn = "block";
        }
        else
        {
            disply1 = "none";
        }
    }

